window.bookSummaryJSON = "<p>Retired hitwoman Celine Briggs loved few people in this world; Her husband Caleb, and her ex-handler, Brian Devereaux. When Celine took her marital vows, she exchanged the life of guns, drugs, and violence for the peaceful life as Caleb's wife. However, not all things buried stay hidden.</p> <p>When Celine's past comes knocking, it rattles her world and forces her back into the life she vowed to give up. Now she is turning up the heat on the streets of Chicago, showing no mercy to the men who've undoubtedly marked themselves.</p> <p>Contains mature themes.</p>"; 
